import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>SP500 VIX Analyzer</h1>
        <p>Financial market analysis and volatility insights</p>
      </header>
      <main>
        <div className="container">
          <h2>Welcome to SP500 VIX Analyzer</h2>
          <p>This application will provide interactive charts and analysis for S&P 500 and VIX data.</p>
          <div className="placeholder">
            <p>Charts and data visualization coming soon...</p>
          </div>
        </div>
      </main>
    </div>
  );
}

export default App;
